import React from "react";
import { Route, Redirect } from "react-router-dom";

function ProtectedRoute({ children, loggedIn }) {
  return (
    <Route path="/">
      {
        () => loggedIn ? children : <Redirect to="/sign-in" />
      }
    </Route>
  );
}

export default ProtectedRoute;
